import React from "react";
import PropTypes from 'prop-types'

import '../img/profile.png'

const Image =(src,alt) =>{


    return(
        <img src={src} alt={alt} />
    )
}

Image.propTypes={
    src:PropTypes.string,
    alt:PropTypes.string
}

Image.defaultProps={
    src:'../img/profile.png',
    alt:'profile picture'
}

export default Image
